import Card, { PinkCard, TopBar, BottomBar } from "./Components.js";
import "./App.css";
import React from "react";

function AccountProtectionScreen() {
    return(
        <>
        <TopBar/>
        <div className="background-color-verylightorange page-intro-styling">
            <div>
                <h1 className="page-title-styling" style={{ color: "darkorange"}}>
                    Account Protection
                </h1>
                <p>
                    Your social media and email accounts hold details about your digital identity<br/>and your personal information. If someone gets access to these accounts, they<br/>can obtain this information or even post and content on your behalf.
                </p>
                <img src={"cybersecurity.jpg"} className="image-styling" alt="security"/>
            </div>
        </div>
        </>
    );
}

export default AccountProtectionScreen;
